import React from 'react'

export default function MemoryCard( {card,handleSelected,disabled} ) {
  
  const isClick = () => {
    if(!disabled){
      handleSelected(card)
    }
  }
  
  return (
    <div className="card">
        <img className='cardFornt' src={card.path} alt="" />
        <img className='cardback' onClick={isClick} src="/img/cover.jpeg" alt="" />
    </div>
  )
}
